import React from "react";
import "./Header.scss";

const Header = (props) => {
  function logout() {
    sessionStorage.setItem("loggedIn", "false");
    props.goto("/");
  }

  return (
    <>
      <div className="sa-header-w">
        <div className="sa-header-tabs-w">
          {headerTabs.map((h, i) => {
            return (
              <div
                key={i}
                className={`sa-header-tab center ${
                  props.selectedHeaderTab === i ? "selected" : ""
                }`}
                onClick={() => props.updateSelectedHeaderTab(i)}
              >
                {h}
              </div>
            );
          })}
        </div>
        <div className="sa-header-profile-section" onClick={() => logout()}>
          Logout
        </div>
      </div>
    </>
  );
};

export default Header;
